import { Row, Container, Col } from "react-bootstrap";

const ProjectCard = ({
  URL,
  projectID,
  title,
  department,
  priority,
  client,
  price,
  startDate,
  endDate,
  team,
  status,
  description,
}) => {
  return (
    <Container>
      <section className="project-card">
        <div className="project-card-header">
          <h3> {title} </h3>
          statu
        </div>

        <Row>
          <p> {description} </p>
          <Col>
            <p>Created</p>
            <p>Team Lead</p>
            <p>Priority</p>
            <p>Dealine</p>
            <p>Comments</p>
            <p>Bug</p>
            <p>Team</p>
          </Col>
          <Col>
            <p>
              <i className="fa-regular fa-calendar-days"></i>{" "}
              {startDate ? startDate : "None"}{" "}
            </p>
            <p>{team ? team : "None"}</p>
            <p className="priority">
              {" "}
              <span className="priority-icon">
                {" "}
                {priority === "high" ? (
                  <i className="fa-solid fa-angle-up priority-icon-high"></i>
                ) : priority === "medium" ? (
                  <i className="fa-solid fa-greater-than priority-icon-medium"></i>
                ) : (
                  <i className="fa-solid fa-angle-down priority-icon-low"></i>
                )}{" "}
              </span>{" "}
              {priority ? priority : "None"}{" "}
            </p>
            <p> {endDate ? endDate : "None"} </p>
            <p>{description ? description : "None"}</p>
            <p>Bug</p>
            <p>{department ? department : "None"}</p>
          </Col>
        </Row>
      </section>
    </Container>
  );
};
export default ProjectCard;
